import NavBar from "./components/navBar/NavBar.jsx"
import Formulario from "./components/formulario/Formulario.jsx"
import PageCadastros from "./pages/PageCadastros.js"
import 'bootstrap/dist/css/bootstrap.min.css';
import { Route, Routes } from 'react-router-dom';


function App() {
  return (
    <section>

      <NavBar />

      <NavBar />
      <Routes>
        <Route path="./pages/pageCadastros.js" element={
          <div>
            <PageCadastros />
          </div>
        }></Route>
      </Routes>


      <nav>
        <Formulario />
      </nav>



    </section>
  );
}

export default App;
